C.TX=new L.D("A toggle to lock and minimize the menu on a large canvas is built in to the menu button. It enables users to hide the side menu or rail in order to make more space available for the app content. You can hide the menu completely or make it a rail, also on desktop and web canvas sizes. Similar user control is also available for the optional sidebar, that can be in the end drawer or pinned to the screen on a large canvas.",null,null,null,null,null,null,null,null)
C.TY=new L.D("You can adjust how Flexfold behaves by changing its setup.\n\nFlexfold offers a large number of responsive behaviors that you can adjust via its API or allow users to modify via settings, like in this demo.\n\nThe navigation mode changes are animated to create a smooth transition from bottom, to rail and side menu. The animation durations and curves can be adjusted.\n\nWidth of the rail, locked menu and sidebar can also be changed, within given limitations.",null,null,null,null,null,null,null,null)
C.U3=new L.D("True black",null,null,null,null,null,null,null,null)
C.U4=new L.D("If you always want to use a bottom border or control when it appears, use this property. With the API you can also modify the color of the bottom border that default to Divider theme color",null,null,null,null,null,null,null,null)
C.U5=new L.D("List tile title",null,null,null,null,null,null,null,null)
C.U6=new L.D("Let us help determine location. This means sending anonymous location data to us.",null,null,null,null,null,null,null,null)
