C.Uc=new L.D("Show canvas size information",null,null,null,null,null,null,null,null)
C.Ue=new L.D("Always use a bottom border on the app bar",null,null,null,null,null,null,null,null)
C.Uf=new L.D("Only useful if you can see content behind the app bar. With the API you can also modify the opacity. Cupertino bottom navigation bar is always frosted glass translucent",null,null,null,null,null,null,null,null)
