C.Ui=new L.D("Show the bottom navigation bar also when the rail or menu is shown. CAUTION: Not recommended, it may be confusing. Useful mostly for testing purposes, but it can also be used as an accessibility feature",null,null,null,null,null,null,null,null)
C.Uj=new L.D("Sidebar title",null,null,null,null,null,null,null,null)
C.Uk=new L.D("About Flexfold demo...",null,null,null,null,null,null,null,null)
