C.Uo=new L.D("FLAT BUTTON",null,null,null,null,null,null,null,null)
C.Ut=new L.D("By default sidebar is a part of the scaffold body. Turn off this setting to have it outside the scaffold, like the side menu and rail. It then also has its own app bar when pinned to the side. This mode is preferred when using a sliver app bar with a side menu",null,null,null,null,null,null,null,null)
C.Uv=new L.D("Use a gradient app bar to make it more dynamic",null,null,null,null,null,null,null,null)
C.Uw=new L.D("Tooltips are nice, but can get in the way when you know the app. Flexfold allows your app to turn them off. Why not give users this choice for all other tooltips in your app too?",null,null,null,null,null,null,null,null)
C.Ux=new L.D("There is a Breakpoint class used to get suitable amount of columns for this demo. It can be used to create different grid layouts all the way up to 4k widths. This screen is a nice stress test on a large canvas. If you maximize this screen on a 4K screen and toggle the menu, the animation will cause all the SVG images on the screen to be rescaled and redrawn in every frame. It is a good stress test of Flutter and it actually works very well, much better than resizing windows in Flutter does. Window resizing and resulting redraws still need improvements in Flutter. This demo app could perhaps be better optimized too.\n\nThe Undraw images bundled with the app are used as demo content in the grid. The images are presented in random order with a box with a border of a random color with high saturation in the light theme mode. In dark theme a less saturated color of the same hue is used. If you toggle the theme using the side menu toggle, you can see the difference. A nice detail to notice is that each image is also using the same random border color as a color theme in each actual image.\n\nThere are only 30 different images. A random reference to each image and its random color are generated and stored in a list the when the page is created. While the list with asset reference and color info is static, the actual images are lazily built with a builder. This demo list stops at 500 items, it's a nice looking Flutter stress test, especially on the web.\n ",null,null,null,null,null,null,null,null)
C.Uy=new L.D("Copy colors to custom",null,null,null,null,null,null,null,null)
C.Uz=new L.D("Use a gradient app bar to make it more dynamic. With the API you can change the strength and direction of the gradient, it is still always based on your active app bar color",null,null,null,null,null,null,null,null)
C.UA=new L.D("Show tooltips",null,null,null,null,null,null,null,null)
C.UB=new L.D("In addition to the indexes, the destination's named route is included as a return value in the class. The navigator source and index change direction are also included. You can use this information to determine how you want to navigate to the destination.\n\nThis demo shows how this destination information can be used to to build different page transitions depending on where you navigated from. From locked side menu there is no transition. From a rail or a drawer the FadeTrough transition from the Flutter Animations packages is used. The bottom navigation uses the shared axis transition. The purpose of this transition design is to use transitions that fit the most likely devices used for the navigation method.\n",null,null,null,null,null,null,null,null)
