C.US=new L.D("The breakpoints for when the navigation type changes can be adjusted, the defaults work well enough for most use cases.\n\nNavigation destination labels only appear as tooltips in rail mode in order to create a slim icon only rail, suitable for tablets and landscape mode on phones.\n\nA sidebar using an end drawer is also supported. It can also become a permanent fixture on a wide enough canvas. The sidebar entrance also animates when its breakpoint is exceeded. Its visibility as a permanent fixture can also be toggled. The widths of the rail, side menu and the tools menu can be individually adjusted. \n\nIn this demo you can play with the settings and observe Flexfold in action. The API for the Flexfold has more features in addition to those demonstrated here.\n\nYou will find the key settings on the Setup page, but there are more usage hints and setup gems on other pages in the this demo app as well.",null,null,null,null,null,null,null,null)
C.UT=new L.D("Switch list tile",null,null,null,null,null,null,null,null)
C.UV=new L.D("Bottom destinations in drawer",null,null,null,null,null,null,null,null)
C.V_=new L.D("Only useful if you can scroll behind the app bar. With the API you can also change the opacity",null,null,null,null,null,null,null,null)
C.V0=new L.D("Normal appbars can be a dull, this demo shows how you can make them more interesting by introducing a gradient into them, together with an optional transparency that also increases gradually.\n\nThe reason for the gradient is just to make the app bar more dynamic and interesting. Whereas the reason for the gradient transparent app bar is more functional and used to display content behind the app bar as content scrolls below it.\n\nA transparent gradient that is opaque at the start of the app bar and increases in transparency towards the end, ensures that the title is visible and keeps the effect subtle. A gradient and transparent app bar is still a matter of opinion and you can turn them off, as well as the 'scrolling behind the app bar or don't use the optional styled constructor at all.\n",null,null,null,null,null,null,null,null)
C.V1=new L.D("Full responsive layout of the content body in this app is not part of the Flexfold demo and has not been paid too much attention to, but it has been verified to work well enough from normal phone sizes to large web and desktop canvas sizes. The content presentation is however not always optimally designed for phones.",null,null,null,null,null,null,null,null)
C.V2=new L.D("To assist with responsive app development testing, you can show current canvas size in the styled app bar. This is probably not a setting you want to enabled for end users, but very handy during development",null,null,null,null,null,null,null,null)
C.V3=new L.D("When you have destinations in a bottom navigation bar and additional destinations in a drawer, you may want the navigation to such additional destinations to be modal when you navigate to them and your canvas is phone sized that does not show all destinations in the rail or side menu.\n\nWith Flexfold you can use the source of the navigation to determine if you want push a full screen route on top of the Flexfold scaffold with only back option available or push a replacement named version of it only into the body part.\n\nFlexfold does not normally show bottom navigation bar destinations in the drawer during bottom bar navigation mode. However, if you navigate to a destination in bottom navigation mode that is not on the bottom navigation bar, then if you open the drawer again after this, you will find the bottom navigation bar destinations in the drawer.\n",null,null,null,null,null,null,null,null)
C.V6=new L.D("Use a drawer and always keep bottom navigation bar hidden. A setting for people that thinks the bottom bar gets in the way",null,null,null,null,null,null,null,null)
C.V7=new L.D("Not Selected Chip",null,null,null,null,null,null,null,null)
C.Va=new L.D("Edge borders are ON by default. With the API you can also change their color. There is also an API edge border switch for light mode, which is OFF by default",null,null,null,null,null,null,null,null)
C.Vb=new L.D("\nFlexfold destinations can also be configured to use FABs. FAB usage can be defined per destination.\n ",null,null,null,null,null,null,null,null)
C.Vd=new L.D("When the view switches to a rail or side menu, the tab view is an excellent choice and works really well for related views for the active destination.\n\nIn this example the tab bar is not anchored to bottom part of the app bar, it is in the top part of the body. The side bar is also present on this screen so we can see how it works with a tab bar view. ",null,null,null,null,null,null,null,null)
C.Vf=new L.D("Top edge border",null,null,null,null,null,null,null,null)
C.Vg=new L.D("Bottom border on black and white app bars",null,null,null,null,null,null,null,null)
C.Vj=new L.D("Show sidebar at",null,null,null,null,null,null,null,null)
C.Vl=new L.D("\nThis demo app does not expose any settings for the FABs, but the pages Setup and Theme have been configured to have and show Floating action buttons.\n\nWith the API the FAB position can also be defined for each navigation mode separately, so that the FAB shows up as expected on the bottom right in phone bottom navigation mode and on the top in tablet and desktop mode.",null,null,null,null,null,null,null,null)
C.Vm=new L.D("The Flexfold layout design is primarily intended for Flutter applications that target Desktop and Web, but it is also useful for resizable apps on tablets and Chrome books. Sure, it works great for switching between portrait and landscape mode on phones and tablets too, offering navigation flexibility on phones and tablets as well.\n\nThis feature demonstration application uses named routing. You do not have to use named routes, but it is recommended. Named routes are easy with Flexfold and they also provide URL based routes if you plan to release your Flutter app on the Web. 'The 'onChangeDestination' callback from the Flexfold package provides not just an index for the tapped destination, but a class with the values that you see in each page header in this demo.\n",null,null,null,null,null,null,null,null)
C.Vn=new L.D("Just because we can and for fun, let us show all the beautiful Undraw SVG images used in this demo app in a grid and then randomly animate in a new one.\n\nEach image box that randomly display one of the images has its own random wait duration before it switches and also a random switch animation time.\n\nEach time the screen is built, each image box gets a random colored border and a less saturated version of it is calculated for dark mode. When you switch to dark mode, it still has the same color hue based on the light theme's random color.\n\nAnother feature is that every image is color themed dynamically to match the color of its border. This is done by changing a color text string in the SVG file image data.\n",null,null,null,null,null,null,null,null)
