C.VL=new L.D("This theme demo uses the newer Flutter Material 2018 typography instead of the older current Flutter default one from 2014. This creates a slightly different look.\n\nThe API to FlexColorScheme allows you to set visualDensity, fontFamily, platform and typography directly without having to use the standard ThemeData factory. For more involved theme customization you can also create the starting point theme data object by using FlexColorScheme().theme and apply additional theming to it with Flutter's standard methods.\n",null,null,null,null,null,null,null,null)
C.VM=new L.D("Not a very common design",null,null,null,null,null,null,null,null)
C.VN=new L.D("This demo app has a mockup user profile as a leading widget showing it can be a complex widget. It is up to the implementation to make one that works OK in all modes",null,null,null,null,null,null,null,null)
C.VO=new L.D("Use a top edge border on the bottom navbar",null,null,null,null,null,null,null,null)
C.VR=new L.D("OUTLINE BUTTON",null,null,null,null,null,null,null,null)
C.VS=new L.D("This feature is required so you do not get stranded without a way back to bottom bar destinations in this navigation mode. Another and a better way to tackle this is to push the destinations that are only in the drawer in this navigation mode as new full screen modal routes on top of the entire Flexfold scaffold with only back option available. This is normal and often preferred way of navigating from such extra drawer destinations.\n\nThis example application has been made to do so, by default using the prefer push info returned by the FlexfoldSelectedDestination information for such destinations, which are Home, Help and About in this demo app.\n\nEven when using this capability, it is still potentially possible to get stranded. If you in rail or menu mode navigate to Home, Help or About the destination should preferably not be pushed as a full screen with only back option, preferably we should only get the destination content replaced into the body part of the app. This demo app works this way. However, in this mode if you then resize the canvas to enable bottom navigation mode, the Home, Help and About views in this app do not know that they should change to full screen view with a back button taking user back to last used bottom navigation destination. In this scenario navigation to the bottom destinations will still be possible as they are now automatically present in the drawer. ",null,null,null,null,null,null,null,null)
C.VV=new L.D("Keep using a rail even when the menu breakpoint is exceeded",null,null,null,null,null,null,null,null)
C.yc=new L.D("Trailing",null,null,null,null,null,null,null,null)
C.VZ=new L.D("The sidebar can of course contain any kind of widget. This example share the same content on all pages that have a side a sidebar, but of course you can show whatever you like, you just have to make sure it fits nicely in the narrow width.\n\nJust for fun, here are some more themed faster switching random Undraw images.",null,null,null,null,null,null,null,null)
