C.Wo=new L.D("Always show bottom navigation",null,null,null,null,null,null,null,null)
C.Wq=new L.D("With Flexfold it is easy to include a gradient transparent app bar, there is a styled app bar factory to help creating app bars like the ones you see in this demo. When you combine the gradient transparent app bar with a white app bar theme, you get a Material themed app bar that resembles common iOS style app bars a bit. It is however not not using the frosted glass filter, but the effect is a bit similar.\n\nThis Tabs page uses a vertical scroll view that stops just before the tab bar, so you will not see the scroll behind app bar effect on this particular page. It is however visible on all other pages in this demo app.\n\nThe Setup page already showed three of the app bar settings. This page introduces a few more features of the app bar made with the styled factory, like control of the bottom border on the app bar, as well as a useful feature for responsive application development, one that shows show current canvas size in the app bar. You can use this to that your responsive layouts break as you intended.\n",null,null,null,null,null,null,null,null)
